import React from "react";
import {
  Button,
  Card,
  Image,
  Container,
  Header,
  Icon,
} from "semantic-ui-react";
import Link from "next/link";

const CardReport = ({ read }) => (
  <Container>
    <div className="cardd">
      {/* {read.confirmed} */}
      <Card.Group className="card-main">
        {Object.keys(read).map((key) => (
          // read[key].value? : null
          <Card>
            <Card.Content>
              <div className="medkit">
                <Icon className="medkit__icon" name="medkit"></Icon>
              </div>
              <Header as="h1">{key}</Header>
              {key === "lastUpdate" ? read[key] : null}
              {key === "confirmed" ? (
                <Link href="/confirmed" as={`/${key}`}>
                  <Button className="button-way">Click</Button>
                </Link>
              ) : null}
              {key === "recovered" ? (
                <Link href="/recovered" as={`/${key}`}>
                  <Button>Click</Button>
                </Link>
              ) : null}

              {key === "deaths" ? (
                <Link href="/deaths" as={`/${key}`}>
                  <Button>Click</Button>
                </Link>
              ) : null}

              <Card.Header>{read[key].value}</Card.Header>
              {/* <Card.Header>{read[key].detail}</Card.Header> */}
              <Card.Meta>Friends of Elliot</Card.Meta>
              <Card.Description>
                Steve wants to add you to the group{" "}
                <strong>best friends</strong>
              </Card.Description>
            </Card.Content>
          </Card>
          // <option value={key}>{read[key].value}</option>
        ))}
      </Card.Group>
      {/* {read.map((key) => {
        <Card.Group>
          <Card>
            <Card.Content>
              <Image
                floated="right"
                size="mini"
                src="https://react.semantic-ui.com/images/avatar/large/steve.jpg"
              />
              <Card.Header>{key.detail}</Card.Header>
              <Card.Meta>Friends of Elliot</Card.Meta>
              <Card.Description>
                Steve wants to add you to the group{" "}
                <strong>best friends</strong>
              </Card.Description>
            </Card.Content>
            <Card.Content extra>
              <div className="ui two buttons">
                <Button basic color="green">
                  Approve
                </Button>
                <Button basic color="red">
                  Decline
                </Button>
              </div>
            </Card.Content>
          </Card>
        </Card.Group>;
      })} */}
    </div>
  </Container>
);

export default CardReport;
